package com.cht.travelandtours.entity;

import java.math.BigDecimal;

public class Package {
    private Long packageId;
    private String name;
    private String description;
    private String destination;
    private int duration;
    private int maxPax;
    private String inclusions;
    private BigDecimal price;
    private boolean active;
    private Long createdByEmployeeId;

    public Package() {
    }

    public Package(Long packageId, String name, String description, String destination,
                   int duration, int maxPax, String inclusions, BigDecimal price,
                   boolean active, Long createdByEmployeeId) {
        this.packageId = packageId;
        this.name = name;
        this.description = description;
        this.destination = destination;
        this.duration = duration;
        this.maxPax = maxPax;
        this.inclusions = inclusions;
        this.price = price;
        this.active = active;
        this.createdByEmployeeId = createdByEmployeeId;
    }

    public Long getPackageId() {
        return packageId;
    }

    public void setPackageId(Long packageId) {
        this.packageId = packageId;
    }

    public String getName() {
        return name;
    }

    public void setName(String name) {
        this.name = name;
    }

    public String getDescription() {
        return description;
    }

    public void setDescription(String description) {
        this.description = description;
    }

    public String getDestination() {
        return destination;
    }

    public void setDestination(String destination) {
        this.destination = destination;
    }

    public int getDuration() {
        return duration;
    }

    public void setDuration(int duration) {
        this.duration = duration;
    }

    public int getMaxPax() {
        return maxPax;
    }

    public void setMaxPax(int maxPax) {
        this.maxPax = maxPax;
    }

    public String getInclusions() {
        return inclusions;
    }

    public void setInclusions(String inclusions) {
        this.inclusions = inclusions;
    }

    public BigDecimal getPrice() {
        return price;
    }

    public void setPrice(BigDecimal price) {
        this.price = price;
    }

    public boolean isActive() {
        return active;
    }

    public void setActive(boolean active) {
        this.active = active;
    }

    public Long getCreatedByEmployeeId() {
        return createdByEmployeeId;
    }

    public void setCreatedByEmployeeId(Long createdByEmployeeId) {
        this.createdByEmployeeId = createdByEmployeeId;
    }
}
